import React from "react";
import propTypes from "prop-types";

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>공통메뉴</div>
      {children}
    </div>
  );
};

// props로 넘기는 애들을 propTypes라는 모듈로 검사하기 (별도 설치 필요)
AppLayout.propTypes = {
  children: propTypes.node.isRequired,
};

export default AppLayout;
